const DUMMY=[
    {id:"444",name:"matan",team:"macabi tel aviv"},
    {id:"123",name:"hadad",team:"hapoel jeruzlem"}
]

const ProjectList=(props:any)=>{


return (
    <ul>
    <div>{props.onProps.map((item:any)=>{
     <li key={item.key}>{item.staff},{item.name},{item.statusId},{item.client}
</li>
    })}</div>
    </ul>
)
}

export default ProjectList
